import React from "react";
import "../components/About.css";

const About = () => {
  return (
    <div>
      <div className="about-section">
        <div className="about-container"></div>
        <div className="about-text-container">
          <h1 className="about-title"></h1>
        </div>
      </div>
    </div>
  );
};

export default About;
